// Box Main
export default function REturnBoX() {
 return (
  <div className='wrp-box-usr'>

   <REturnIcon icons={<BsWallet size={'1em'} />} Text={'Pay or send money'} />
   <REturnIcon icons={<BsWallet size={'1em'} />} Text={'Get'} />

  </div>
 );
};
